package com.pcs.device.gateway.enevo.onecollect.api.snapshot.beans;

import java.util.List;

import com.fasterxml.jackson.annotation.JsonAutoDetect;
import com.fasterxml.jackson.annotation.JsonInclude;
import com.fasterxml.jackson.annotation.JsonInclude.Include;

@JsonAutoDetect
@JsonInclude(value = Include.NON_NULL)
public class SiteContentType {
	public SiteContentType() {
		// TODO Auto-generated constructor stub
	}

	private long id;
	private int contentType;
	private String contentTypeName;
	private long site;
	private int fillLevel;
	private String dateWhenFull;
	private String lastCollection;
	private List<ContainerSlot> containerSlots;
	private String lastModified;
	public long getId() {
		return id;
	}

	public void setId(long id) {
		this.id = id;
	}

	public int getContentType() {
		return contentType;
	}

	public void setContentType(int contentType) {
		this.contentType = contentType;
	}

	public String getContentTypeName() {
		return contentTypeName;
	}

	public void setContentTypeName(String contentTypeName) {
		this.contentTypeName = contentTypeName;
	}

	public long getSite() {
		return site;
	}

	public void setSite(long site) {
		this.site = site;
	}

	public int getFillLevel() {
		return fillLevel;
	}

	public void setFillLevel(int fillLevel) {
		this.fillLevel = fillLevel;
	}

	public String getDateWhenFull() {
		return dateWhenFull;
	}

	public void setDateWhenFull(String dateWhenFull) {
		this.dateWhenFull = dateWhenFull;
	}

	public String getLastCollection() {
		return lastCollection;
	}

	public void setLastCollection(String lastCollection) {
		this.lastCollection = lastCollection;
	}

	public List<ContainerSlot> getContainerSlots() {
		return containerSlots;
	}

	public void setContainerSlots(List<ContainerSlot> containerSlots) {
		this.containerSlots = containerSlots;
	}

	public String getLastModified() {
		return lastModified;
	}

	public void setLastModified(String lastModified) {
		this.lastModified = lastModified;
	}

}
